To talk about best practices for upgradeability, we need to first understand what can be upgraded in a package. The base premise of upgradeability is that an upgrade should not break public compatibility with the previous version. The parts of the module which can be used in dependent packages should not change their static signature. This applies to modules - a module can not be removed from a package, public structs - they can be used in function signatures and public functions - they can be called from other packages. // module can not be removed from the package
module book::upgradable { // dependencies can be changed (if they are not used in public signatures) use std::string::String; use sui::event; // can be removed // public structs can not be removed and can't be changed public struct Book has key { id: UID, title: String, } // public structs can not be removed and can't be changed public struct BookCreated has copy, drop { /* ... */ } // public functions can not be removed and their signature can never change // but the implementation can be changed public fun create_book(ctx: &mut TxContext): Book { create_book_internal(ctx) // can be removed and changed event::emit(BookCreated { /* ... */ }) } // package-visibility functions can be removed and changed public(package) fun create_book_package(ctx: &mut TxContext): Book { create_book_internal(ctx) } // entry functions can be removed and changed as long they're not public entry fun create_book_entry(ctx: &mut TxContext): Book { create_book_internal(ctx) } // private functions can be removed and changed fun create_book_internal(ctx: &mut TxContext): Book { abort 0 }
}

