A developer is often tempted to add a public function that would assert all the conditions and abort the execution. However, it is a better practice to create a function that returns a boolean value instead. This way, the caller module can handle the error and provide a meaningful error message to the user. module book::some_app_assert { const ENotAuthorized: u64 = 0; public fun do_a() { assert_is_authorized(); // ... } public fun do_b() { assert_is_authorized(); // ... } /// Don't do this public fun assert_is_authorized() { assert!(/* some condition */ true, ENotAuthorized); }
} This module can be rewritten as follows: module book::some_app { const ENotAuthorized: u64 = 0; public fun do_a() { assert!(is_authorized(), ENotAuthorized); // ... } public fun do_b() { assert!(is_authorized(), ENotAuthorized); // ... } public fun is_authorized(): bool { /* some condition */ true } // a private function can still be used to avoid code duplication for a case // when the same condition with the same abort code is used in multiple places fun assert_is_authorized() { assert!(is_authorized(), ENotAuthorized); }
} Utilizing these three rules will make the error handling more transparent to the caller of the transaction, and it will allow other developers to use custom abort codes in their modules.

